class Solution:
    def maximalSquare(self, matrix):
        """
        :type matrix: List[List[str]]
        :rtype: int
        """
        l = len(matrix)
        if l==0:
            return 0
        b = len(matrix[0])
        opt = [[0] * b for _ in range(0, l)]
        max_square = 0
        for i in range(0, l):
            opt[i][0] = int(matrix[i][0])
            max_square = max(max_square, opt[i][0])
        for j in range(0, b):
            opt[0][j] = int(matrix[0][j])
            max_square = max(max_square, opt[0][j])

        for i in range(1, l):
            for j in range(1, b):
                if matrix[i][j] == "1":
                    opt[i][j] = min(opt[i-1][j], opt[i][j-1], opt[i-1][j-1]) + 1
                else:
                    opt[i][j] = 0
                max_square = max(max_square, opt[i][j])
        return max_square*max_square

